// src/components/Display.js
import React, { useEffect } from 'react';
import io from 'socket.io-client';
import $ from 'jquery';
import 'bootstrap/dist/css/bootstrap.min.css';

const socket = io('http://localhost:5000'); // Update with your server URL
console.log('screen-data in ui');
function connectRoom() {
    debugger
    var room = document.getElementById('partnerID').value;
    if (room.trim().length === 0) {
        alert("Room ID is mandatory to join");
        return;
    }
    socket.emit("join-message", room);
    socket.on('screen-data', function (message) {
        console.log('screen-data in ui');
        $("img").attr("src", "data:image/png;base64," + message);
    });
    socket.on('new-unshare-data', function () {
        debugger
        console.log('user unshare the screen');
        $("img").attr("src", "data:image/png;base64,");
        window.location.reload();
    });
    $("img").on("mousemove", function (event) {
        var imgOffset = $(this).offset(); // Get the position of the image
        var mouseX = event.pageX - imgOffset.left;
        var mouseY = event.pageY - imgOffset.top;
        var obj = {
            x: mouseX,
            y: mouseY,
            room: room
        };
        socket.emit("mouse-move", JSON.stringify(obj));
    });
    $("img").on("click", function (e)  {
        var obj = { "room": room };
        socket.emit("mouse-click", JSON.stringify(obj));
    });
    $(window).on("keyup", function (e) {
        var splKey = '';
        if (e.altKey) splKey = 'alt';
        if (e.ctrlKey) splKey = 'control';
        if (e.shiftKey) splKey = 'shift';
        var obj = { 'key': e.key.toLowerCase(), 'room': room, 'splKey': splKey };
        socket.emit("type", JSON.stringify(obj));
    });
    $('#remoteComputerModal').modal('hide'); // Close the modal
}

function Display() {
    debugger
    useEffect(() => {
        $('#remoteComputerModal').modal('show');
        return () => {
            socket.disconnect();
        };
    }, []);

    return (
        <div style={{ background: '#007bff' }}>
            <img id="image" style={{ width: '90%', height: '90%', marginTop: '2%', marginLeft: '5%' }} alt="Remote Screen" />
            <div className="modal fade" id="remoteComputerModal" tabIndex="-1" role="dialog" aria-labelledby="remoteComputerModalLabel" aria-hidden="true">
                <div className="modal-dialog" role="document">
                    <div className="modal-content">
                        <div className="modal-header">
                            <h5 className="modal-title" id="remoteComputerModalLabel">Control a Remote Computer</h5>
                        </div>
                        <div className="modal-body">
                            <div className="form-group">
                                <label htmlFor="computerName">Partner ID</label>
                                <input type="text" className="form-control" id="partnerID" />
                            </div>
                        </div>
                        <div className="modal-footer">
                            <button type="button" className="btn btn-primary" id="connectBtn" onClick={connectRoom}>Connect</button>
                        </div>
                    </div>
                </div>
            </div>
            <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.5.1/jquery.min.js"></script>
            <script src="https://cdnjs.cloudflare.com/ajax/libs/socket.io/3.0.4/socket.io.js" crossOrigin="anonymous"></script>
            <script src="https://maxcdn.bootstrapcdn.com/bootstrap/4.5.2/js/bootstrap.min.js"></script>
        </div>
    );
}
Display();
export default Display;
